import React from 'react';

const VadResults = ({ timestamps }) => {
  return (
    <div className="p-6 bg-white shadow-md rounded-lg">
      <h2 className="text-2xl font-semibold mb-4">Voice Activity Detection Results</h2>
      {timestamps.length > 0 ? (
        <ul className="list-disc list-inside">
          {timestamps.map(([start, end], index) => (
            <li key={index} className="text-gray-700">
              Silence from {start.toFixed(2)}s to {end.toFixed(2)}s
            </li>
          ))}
        </ul>
      ) : (
        <p className="text-gray-500">No voice activity detected.</p>
      )}
    </div>
  );
};

export default VadResults;
